import React from "react";
import styled from 'styled-components'
import SidebarItem from "./SidebarItem";

const SidebarParent = styled.div`
  background: #c34a36;
  width: 250px;
  height: 100vh;
`

function Sidebar() {
    return (
        <>
            <SidebarParent>
                {SidebarItem.map((item)=>
                item.name)}
            </SidebarParent>
        </>
    );
}

export default Sidebar;
